import React from "react";
import { Link, Route, Routes, Navigate } from "react-router-dom";
import image from "./images/Img.jpeg";
import image2 from "./images/img2.jpg";
import WeatherInfo from "./weather/WeatherInfo";
import Country from "./component1/Country";
import Home from "./component1/Home";

import Country1 from "./component1/Country1";
import PageOne from "./page/PageOne";
import PageTwo from "./page/PageTwo";
import PageThree from "./page/PageThree";
import NavBar from "./page/NavBar";
import Details from "./page/Details";

function App() {
  return (
    <div className="main">
      <div className="brand">
        <img src={image} className="logo" />
        <h2>Trip go where </h2>
        <h1 className="WishList">WishList</h1>
      </div>
      <div className="nav-menu">Welcome to Trip go where App</div>

      <div>
        <div className="title">
          <img src={image2} className="img2"></img>
        </div>
        <div className="moveup">
          <h1>TRAVEL TO EXPLORE</h1>

          <div className="search">
            <div className="container">
              <label htmlFor="">where you'd like to go</label>
              <input type="text" placeholder="search your location" />
            </div>
          </div>
          <div className="search">
            <div className="container">
              <label htmlFor="">Check in </label>
              <input type="date" />
            </div>
          </div>
          <div className="search">
            <div className="container">
              <label htmlFor="">Check out</label>
              <input type="date" />
            </div>
            <button>explore Now</button>
          </div>
        </div>
      </div>

      <div>
        {" "}
        <NavBar />
        <main>
          <Routes>
            <Route path="/" element={<Navigate replace to="/" />} />
            <Route path="/page-one" element={<PageOne />} />
            <Route path="/page-one/:item" element={<Details />} />
            <Route path="/page-two" element={<PageTwo />} />
            <Route path="/page-three" element={<PageThree />} />
          </Routes>
        </main>
      </div>
    </div>
  );
}
